#include <fstream>
#include <vector>

int main() {
  std::ifstream in("cod.in");
  std::ofstream out("cod.out");

  int n;
  in >> n;

  std::vector<int> count(100, 0);
  for (int i = 0; i < n; i++) {
    int x;
    in >> x;
    count[x]++;
  }

  for (int i = 0; i < 100; i++) {
    if (count[i] % 2 != 0) {
      out << i;
    }
  }

  out.close();
  return 0;
}
